import React from 'react'

const Contact = () => {
  return (
    <div>
      <ul className='text-center text-xl'>
        <li className='p-4'>Mon téléphone : 06.86.03.22.87</li>
        <li className='p-4' >Mon adresse email : cocogamingsub@gmail.com</li>
      </ul>
    </div>
  )
}

export default Contact;
